import React from "react";

import './carrouselStyle.css'

import pizzaCalabresa from '../../assets/pizzaCalabresa.jpg'
import pizzaQueijo from '../../assets/pizzaQueijo.jpg'
import pizzaDoce from '../../assets/pizzaBanana.jpg'
import { Container, Carousel, Image } from "react-bootstrap";

function CarrouselPizza() {
  return (
    <Container fluid>
      <Carousel>
        <Carousel.Item >
          <Image 
            src={pizzaCalabresa}
            fluid
          />
        </Carousel.Item>
        <Carousel.Item>
        <Image 
            src={pizzaCalabresa}
            fluid
          />
          <img
            className="d-block w-100"
            src={pizzaQueijo}
            height="600px"
          />
        </Carousel.Item>
        <Carousel.Item>
          <img
            className="d-block w-100"
            src={pizzaDoce}
            alt="First slide"
            height="600px"
          />
        </Carousel.Item>
      </Carousel>
    </Container>
    
  );
}

export default CarrouselPizza;
